import React from 'react';

const Footer = () => {
    return ( 
        <div className="footer">
            <div className="footer-list">
                <ul>
                    <li>Sign In</li>
                    <li>About Us</li>
                    <li>Help Center</li>
                    <li>Contact</li>
                </ul>
            </div>
        </div>
     );
}

export default Footer;
